import React from 'react';
import './Register.scss';
import axios from 'axios';

let url = "http://localhost:8000/api/v1/users";

let userData = {};

export default function Register() {

  let [usersData, setUsersData] = React.useState();

  let createUser = () => {

    axios.post(
      url,usersData
    )
    .then (
      res => {
        setUsersData (
          prevState => [...prevState, res]
        )
      }
    )
  }

  return (
    <div className='Register__container'>
      <span className='Register__header'>
        sign up for new account
      </span>

      <form>
        <input type="text" name='email' placeholder='email' onChange={(e)=> {userData.email = e.target.value}}/>
        <input type="text" name='name' placeholder='name' onChange={(e)=> {userData.name = e.target.value}}/>
        <input type="password" name='password' placeholder='password' onChange={(e)=> {userData.password = e.target.value}}/>

      </form>
      <button onClick={createUser}>submit</button>
    </div>
  )
}
